import React from 'react'
import './alert.css'

export default function Alert() {
  return (
    <div class="alert">
        <span class="closebtn" onclick="this.parentElement.style.display='none';">&times;</span> 
        <strong>Notice</strong> Webiste Still Under Develpment.
    </div>
  )
}
